commit.message:
refactor!: make `max_files` a property

Implements the idea mentioned here:

- https://github.com/wincent/command-t/commit/660d2417ad86860830cbfb2b64d3a8830a7ebceb#commitcomment-130040560

Instead of:

    finders = {
      ack = {
        command = function(directory)
          local command = 'ack -f --print0'
          if directory ~= '' and directory ~= '.' and directory ~= './' then
            directory = vim.fn.shellescape(directory)
            command = command .. ' -- ' .. directory
          end
          local drop = 0
          local max_files = 10000
          return command, drop, max_files
        end,
      },
    },

where the multiple return values are getting unwieldy and things will
get crazy if I add any more, you now write:

    finders = {
      ack = {
        command = function(directory)
          local command = 'ack -f --print0'
          if directory ~= '' and directory ~= '.' and directory ~= './' then
            directory = vim.fn.shellescape(directory)
            command = command .. ' -- ' .. directory
          end
          return command
        end,
        max_files = 10000,
      },
    },

or, if you want to compute the value dynamically based on the current
options:

    finders = {
      ack = {
        command = function(directory)
          local command = 'ack -f --print0'
          if directory ~= '' and directory ~= '.' and directory ~= './' then
            directory = vim.fn.shellescape(directory)
            command = command .. ' -- ' .. directory
          end
          return command
        end,
        max_files = function(options)
          -- Imagine we want to use the same value as is configured for
          -- rg:
          return options.scanners.rg.max_files
        end,
      },
    },

feat: implement max_files option in a number of places

Unlike in the Ruby version, the Lua version allows you to set a
different limit for each scanner, becauase different scanners have
different performance characteristics.

  commandt.setup({
    scanners = {
      file = {
        max_files = 100000, -- A "big" limit.
      },
      find = {
        max_files = 10, -- A small limit.
      },
      git = {
        max_files = 0, -- Same as no limit.
      },
      rg = {
        -- No setting, no limit.
      },
    }

A subsequent commit will explain the details of how to set this up, but
in brief, setting the limit to "0" (or omitting the limit) means no
limit. If you have circular symlinks in a filesystem, then the limit
stops Command-T for scanning forever (particularly in the case of the
`:CommandT` — "find" — scanner).

If you have a custom command-based scanner, then you can supply a
"max_files" limit in your return value; eg. a limit of 10,000 like so:

    finders = {
      ack = {
        command = function(directory)
          local command = 'ack -f --print0'
          if directory ~= '' and directory ~= '.' and directory ~= './' then
            directory = vim.fn.shellescape(directory)
            command = command .. ' -- ' .. directory
          end
          local drop = 0
          local max_files = 10000
          return command, drop, max_files
        end,
      },
    },

Disclaimer: this is only exceedingly lightly tested, so I'm going to
park it on the "next" branch for a bit before merging to "main".

Note: formatting changes due to running "bin/format" included.

